import React, { Component } from "react";

class Navigation extends Component {
  handleSelection = (id) => {
    if (id === 1) {
      console.log("Lämpötila");
    } else if (id === 2) {
      console.log("Salamat");
    }
  };
  handleData = () => {
    console.log("pää");
    var SERVER_URL = "http://opendata.fmi.fi/wfs";
    var STORED_QUERY_OBSERVATION =
      "fmi::observations::weather::multipointcoverage";
    var connection = new fi.fmi.metoclient.metolib.WfsConnection();
    if (connection.connect(SERVER_URL, STORED_QUERY_OBSERVATION)) {
      // Connection was properly initialized. So, get the data.
      connection.getData({
        requestParameter: "td",
        begin: new Date(1368172800000),
        end: new Date(1368352800000),
        timestep: 60 * 60 * 1000,
        sites: "Helsinki",
        callback: function (data, errors) {
          console.log(data);
          // Disconnect because the flow has finished.
          connection.disconnect();
        },
      });
    }
  };

  render() {
    return (
      <div id="nav">
        <ul className="nav nav-pills nav-fill bg-dark">
          <li className="nav-item">
            <a
              onClick={() => this.handleSelection(1)}
              className="nav-link text-white"
              href="#"
            >
              Lämpötilahistoria
            </a>
          </li>
          <li className="nav-item">
            <a
              onClick={() => this.handleSelection(2)}
              className="nav-link text-white"
              href="#"
            >
              Salamat
            </a>
          </li>
          <li className="nav-item">
            <a
              className="nav-link text-white"
              onClick={() => this.handleData()}
              href="#"
            >
              Testaa data
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link text-white" href="#">
              Jotain
            </a>
          </li>
        </ul>
      </div>
    );
  }
}

export default Navigation;
